const Index = () => {
  console.log(index);
  return (
    <div className="home-page">
      <div className="station-info">
        <div className="station">
          <div className="from">北京</div>
          <i className="iconfont icon-qiehuan"></i>
          <div className="to">上海</div>
        </div>
      </div>
    </div>
  );
};
export default observer(Index);
